import React, { useState } from 'react';
import '../styles/DebugPanel.css';

const DebugPanel = () => {
  const [isOpen, setIsOpen] = useState(false);
  const [activeTab, setActiveTab] = useState('wallets');
  const [testResult, setTestResult] = useState(null);
  const [isRunningTest, setIsRunningTest] = useState(false);
  
  const runApiTest = async (type) => {
    setIsRunningTest(true);
    setTestResult(null);
    
    try {
      let result;
      
      switch (type) {
        case 'bitcoin-balance':
          result = await window.walletAPI.getBalance('wallet-1', 'bitcoin', '1A1zP1eP5QGefi2DMPTfTL5SLmv7DivfNa');
          break;
        case 'ethereum-balance':
          result = await window.walletAPI.getBalance('wallet-1', 'ethereum', '0x742d35Cc6634C0532925a3b844Bc454e4438f44e');
          break;
        case 'token-balance':
          result = await window.walletAPI.getTokenBalance('wallet-1', 'ETH', '0x742d35Cc6634C0532925a3b844Bc454e4438f44e', '0xdAC17F958D2ee523a2206206994597C13D831ec7');
          break;
        case 'list-wallets':
          result = await window.walletAPI.listWallets();
          break;
        case 'get-accounts':
          result = await window.walletAPI.getAccounts('wallet-1');
          break;
        case 'create-wallet':
          result = await window.walletAPI.createWallet({
            name: 'Test Wallet',
            password: 'testpassword',
            seedPhrase: 'abandon ability able about above absent absorb abstract absurd abuse access accident'
          });
          break;
        default:
          result = { success: false, error: 'Bilinmeyen test tipi' };
      }
      
      setTestResult(result);
    } catch (error) {
      setTestResult({ success: false, error: error.message });
    } finally {
      setIsRunningTest(false);
    }
  };
  
  const clearLocalStorage = () => {
    localStorage.clear();
    alert('LocalStorage temizlendi. Uygulamayı yenileyin.');
  };
  
  const resetWalletEngine = () => {
    // Bu fonksiyon gerçekte wallet-engine verilerini sıfırlayacak
    alert('Wallet Engine sıfırlama gerçekleştirildi. Uygulamayı yenileyin.');
  };
  
  if (!isOpen) {
    return (
      <button 
        className="debug-toggle-button" 
        onClick={() => setIsOpen(true)}
        title="Geliştirici Araçları"
      >
        <i className="fas fa-bug"></i>
      </button>
    );
  }
  
  return (
    <div className="debug-panel">
      <div className="debug-header">
        <h3>Geliştirici Araçları</h3>
        <button className="close-button" onClick={() => setIsOpen(false)}>
          <i className="fas fa-times"></i>
        </button>
      </div>
      
      <div className="debug-tabs">
        <button 
          className={`tab-button ${activeTab === 'wallets' ? 'active' : ''}`} 
          onClick={() => setActiveTab('wallets')}
        >
          Cüzdanlar
        </button>
        <button 
          className={`tab-button ${activeTab === 'api' ? 'active' : ''}`} 
          onClick={() => setActiveTab('api')}
        >
          API Testleri
        </button>
        <button 
          className={`tab-button ${activeTab === 'storage' ? 'active' : ''}`} 
          onClick={() => setActiveTab('storage')}
        >
          Depolama
        </button>
      </div>
      
      <div className="debug-content">
        {activeTab === 'wallets' && (
          <div className="tab-content">
            <h4>Cüzdan Yönetimi</h4>
            
            <div className="action-buttons">
              <button onClick={() => runApiTest('list-wallets')}>
                Cüzdanları Listele
              </button>
              <button onClick={() => runApiTest('get-accounts')}>
                Hesapları Getir
              </button>
              <button onClick={() => runApiTest('create-wallet')}>
                Test Cüzdanı Oluştur
              </button>
            </div>
          </div>
        )}
        
        {activeTab === 'api' && (
          <div className="tab-content">
            <h4>API Testleri</h4>
            
            <div className="action-buttons">
              <button onClick={() => runApiTest('bitcoin-balance')}>
                Bitcoin Bakiyesi
              </button>
              <button onClick={() => runApiTest('ethereum-balance')}>
                Ethereum Bakiyesi
              </button>
              <button onClick={() => runApiTest('token-balance')}>
                USDT (ERC20) Bakiyesi
              </button>
            </div>
          </div>
        )}
        
        {activeTab === 'storage' && (
          <div className="tab-content">
            <h4>Depolama Yönetimi</h4>
            
            <div className="action-buttons">
              <button onClick={clearLocalStorage} className="warning-button">
                LocalStorage Temizle
              </button>
              <button onClick={resetWalletEngine} className="danger-button">
                Wallet Engine Sıfırla
              </button>
            </div>
            
            <div className="storage-content">
              <h5>LocalStorage İçeriği:</h5>
              <pre>
                {JSON.stringify(
                  Object.keys(localStorage).reduce((obj, key) => {
                    try {
                      obj[key] = JSON.parse(localStorage.getItem(key));
                    } catch (e) {
                      obj[key] = localStorage.getItem(key);
                    }
                    return obj;
                  }, {}),
                  null,
                  2
                )}
              </pre>
            </div>
          </div>
        )}
        
        {testResult && (
          <div className={`test-result ${testResult.success ? 'success' : 'error'}`}>
            <h5>{testResult.success ? 'Test Başarılı' : 'Test Başarısız'}</h5>
            <pre>{JSON.stringify(testResult, null, 2)}</pre>
          </div>
        )}
        
        {isRunningTest && (
          <div className="loading-indicator">
            <div className="spinner"></div>
            <p>Test çalıştırılıyor...</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default DebugPanel;
